import ItemTienda from "../components/index_components/ItemTienda";
import Footer from "../components/index_components/Footer";

const Index = (props) => {
  //console.log(props.users);
  return (
    <>
      <Header videoLink="https://firebasestorage.googleapis.com/v0/b/shopar-2020.appspot.com/o/video.mp4?alt=media&token=e3786ab1-a20b-4f4a-ab1b-087f16a53a35" />
      <Container title="ShopAR">
        <MenuTiendas>
          <ItemTienda
            title="Imagen de prueba"
            alt="Tienda 1"
