            alt="Tienda 1"
            image="https://source.unsplash.com/eUCy1jb_B7I/700x500"
            href="/tienda"
          />
          <ItemTienda
            title="Imagen de prueba"
            alt="Tienda 1"
            image="https://source.unsplash.com/eUCy1jb_B7I/700x500"
            href=""
          />
        </MenuTiendas>
      </Container>
      <Footer />
    </>
  );
};

